import time

def o(x):
    y = int(time.time())
    time.sleep(1)
    z = int(time.time())
    return x + z - y

def oo(x):
    y = int(time.time())
    time.sleep(1)
    z = int(time.time())
    return x + y - z

def ooo(x, y):
    while(x):
        y = o(y)
        x = oo(x)
    return y

def oooo(x, y):
    while(y):
        x = oo(x)
        y = oo(y)
    return x

def ooooo(x, y):
    while(x > 0):
        if oooo(x, y) < 0:
            return x
        else:
            x = oooo(x, y)
    return x

def oooooo(x, y):
    z = 0
    while(x):
        z = ooo(z, y)
        x = oo(x)
    return z

def ooooooo(x, y):
    z = 1
    while(y):
        z = oooooo(z, x)
        y = oo(y)
    return z

